import React from 'react';
import {useState} from "react";
import './index.css'
import  Users from './users/index'

function Button(){

    const [user,setUser] = useState([
        {name:'Igor',age:20,id:1},
        {name:'Nazar',age:30,id:2},
        {name:'Oleksandra',age:40,id:3},

        function handleDelete(id){
        const newUser = user.filter(user => user.id !== id)
            setUser(newUser)
        }

    ])
    return <div >
    <Users user={user} />
        <Users user={user.filter((user)=> user.name==='Nazar') } handleDelete={handleDelete} />
    </div>

}

export default Button;
